import React from 'react';



const Header =()=>{
return(
    <>
            <ul>
                <li><a>Home</a></li>
                <li><a>Projects</a></li>
                <li><a>Contact</a></li>
                <li><a>About Us</a></li>
            </ul>
       
    
    </>
    );
};
export default Header;
